#! /bin/bash

# collect the names/paths of the boost subprojects
for f in $( find ../../thirdparty/owemdjee/boost/ -mindepth 2 -maxdepth 2 -type d -path '*/libs/*' ) ; do
	echo $f
	name=$( basename $f )
	if [ -f libboost-${name}.vcxproj ] ; then
		echo "Project file for ${name} already present!   Nothing to do!  :-)"
	else
		echo "BOOST project ${name} ..."
		cp libboost-core.vcxproj libboost-${name}.vcxproj
		sed -e "s/-core-/-${name}-/g"   < libboost-core.spec   > libboost-${name}.spec
		echo '// TBD' >> ../../scripts/boost/libboost-${name}-dummy.cpp
	fi
done

# update/regenerate the project files: this corrects our blunt copying from libboost-core.vcxproj above. :-)
./mknew.sh 1234 libboost

# ditto for the 'TBD' dummy source file which is meant to load all include files as a compile-time test of the boost (sub)project at hand.
./regenerate-boost-dummy-cpp-files.sh

